import React from 'react'

const ContactUs = () => {
  return (
    <>
    <div className="contactUs">
        <div className="contact-img">
        <div className="img"><img src={require('../images/Online world-pana.png')} alt="" /></div>
        </div>

    </div>
    
    </>
  )
}

export default ContactUs
